import Home from "./components/Home";
import { NavBar } from "./components/NavBar";
importAbout

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <NavBar />

        <h1>Our App</h1>
        <Route exact path="/" component={Home} />
        <Route exact path="/About" component={About}/>

      </header>
    </div>
  );
}

export default App;
